import React from "react";

import classes from "./Section.module.css";

const Section = (props) => {
  return (
    <section className={`${classes.section} ${props.className}`} id="home">
      <div className={classes["section__name"]}>
        <div className={classes["section__content"]}></div>
      </div>
    </section>
  );
};

export default Section;
